import React, { useEffect, useState } from 'react'
import axios from 'axios'
import ph from '../../../images/gamesPhoto/Atalayar_FIFA 21.jpg';


const GamesHome = () => {
    const [games, setgames] = useState([])
    useEffect(() => {
        axios.get('http://localhost:5000/game/home')
            .then((res) => {
                console.log(res.data);
                setgames(res.data)
            })
            .catch((err) => console.log(err))

    }, [])

    const gameView = games.map((game) => (
        <img src={require(`../../../images/gamesPhoto/${game.gamePhoto}`)} />
    ));
    return (
        <div>
            <h1>OUR GAMES</h1>
            {gameView}

        </div>
    )
}

export default GamesHome
